export default {
    /** Upcoming Launches Spacex */
    getTwitterTrends: () => {
        return fetch(config.baseApiUrl + 'twitter-trends').
            then((Response) => Response.json())
            .catch({ status: 500, message: 'Internal Server Error' });
    }
}
